export default function Contact(props){
    let contact=props.content;
    return (
        <>
            <div className="flex gap-2" id="contact">
                <div className="h-80 relative w-1/2">
                    <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQaUanxBSPWKztUx51vuqzmY9K0jqg3k5jERW9TJm3yu2sj54zF3kL-z8LIS_21sw4vWQ0&usqp=CAU" className="bgImageClass"></img>
                    <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQaUanxBSPWKztUx51vuqzmY9K0jqg3k5jERW9TJm3yu2sj54zF3kL-z8LIS_21sw4vWQ0&usqp=CAU" className="contactImg"></img>
                </div>
                <div className="bg-white p-3 rounded-md text-center shadow-2xl shadow-indigo-200 hover:shadow-indigo-300 transition ease-in-out hover:-translate-y-1 cursor-pointer " key={el.id}>
                {
                    contact.map((el)=>(
                            <h1 className="font-bold text-3xl mb-1 text-indigo-950">{el?.label}</h1>
                    ))
                }
                </div>
            </div>
        </>
    )
}
